import React from "react";
import Logo from "../img/Logo.jpg";

function Search() {
  return (
    <div>
      <img src={Logo}/>
      <input
        type={"text"}
        style={{
          borderColor: "blue",
          borderRadius: "3px",
          width: "582px",
          height: "52px",
          border: "solid 2px #19ce60",
        }}
      />
    </div>
  );
}

export default Search;
